import React, {memo} from 'react';
import styled from 'styled-components';

const IntroduceContainer = styled.div`
    background-color: #333;
    width:100%;

    .contentInner{
        max-width: 1200px;
        margin:80px auto;
    }
`;

const Introduce = memo(() => {
  return (
    <IntroduceContainer>
        <div className='contentInner'>
            <h1>Introduce</h1>
        </div>
    </IntroduceContainer>
  );
});

export default Introduce;
